import React from 'react';
import Card from './Card';
import Sdata from './Sdata';
import Tvf from './tvf';

const fseries = 'amazon';

const FavSSeries = () => {
  if (fseries === 'tvf') {
    <Tvf />;
  } else {
    return (
      <Card
        key={Sdata[8].id}
        simg={Sdata[8].simg}
        sname={Sdata[8].sname}
        stitle={Sdata[8].stitle}
        slink={Sdata[8].slink}
      />
    );
  }
};

const App = () => (
  <>
    <h1 className='heading'>Best Web Series</h1>
    <FavSSeries />
  </>
);

export default App;
